import React from "react";
import { Carousel, Image } from "react-bootstrap/";
import "bootstrap/dist/css/bootstrap.min.css";

function CommonBurger() {
  return (
    <Carousel>
      <Carousel.Item style={{ height: "250px" }}>
        <img src="/image/1.jpg" style={{ width: "100%", height: "150px" }} />
        <img src="/image/1.jpg" style={{ width: "100%", height: "250px" }} />
      </Carousel.Item>
    </Carousel>
  );
}

export default CommonBurger;
